INSERT INTO `chapitres` (`id`, `title`, `content`, `Course_id`) VALUES
(1, 'variabels', 'Java—An Introduction\r\nJava is a simple, object oriented, high performance language. It is \r\ndistributed, portable, multi-threaded, and interpreted—mainly intended \r\nfor the development of object oriented, network based software for \r\nInternet applications. ‘Internet’ implies heterogeneous systems, \r\ndifferent network features, different windows libraries, and different \r\noperating systems. Java guarantees identical program behavior on \r\ndifferent platforms.\r\nA Brief History of Java\r\nIn 1990, Sun Microsystems began a project called Green to develop \r\nsoftware for consumer electronics. Developer, Gosling began writing \r\nsoftware in C++ for embedding into such items as toasters, VCR’s, and \r\nPersonal Digital Assistants (PDA’s). The embedded software makes many \r\nappliances more intelligent. Gosling’s solution to the problems of C++ \r\nwas a new language called Oak. Finally in 1995, Oak was renamed Java. \r\nSince then Java has been rising in popularity.\r\nBytecode\r\nThe key that allows Java to solve both the security and the \r\nportability problems is that the output of a Java Compiler is not an \r\nexecutable code, rather it is a bytecode.\r\nBytecode is a highly optimized set of instructions designed to be \r\nexecuted by the Java runtime system, which is called the Java Virtual \r\nMachine (JVM). It is an interpreter for bytecode.\r\nIn the Java programming language, all source code is first written in\r\n plain text files ending with the .java extension. Those source files \r\nare then compiled into .class files by the javac compiler. A .class file\r\n does not contain code that is native to your processor; it instead \r\ncontains bytecode—the language of the JVM.\r\nThe Java launcher tool then runs your application with an instance of the Java Virtual Machine.\r\nThe Java VM is available on many different operating systems, \r\ntherefore the same .class files are capable of running on Microsoft \r\nWindows, the Solaris™ Operating System (Solaris OS), Linux, or Mac OS. \r\nSome virtual machines, such as the Java HotSpot Virtual Machine, perform\r\n additional steps at runtime such as finding performance bottlenecks and\r\n recompiling (to native code) frequently used sections of code.\r\nJava Versus C++\r\nJava is a true object oriented language while C++ is basically C with\r\n an object oriented extension. Listed below are some major C++ features \r\nthat were intentionally omitted from Java, or significantly modified:\r\nJava does not support operator overloading.\r\nJava does not have template classes.\r\nJava does not support multiple inheritance of classes.\r\nJava does not support global variables.\r\nJava does not use pointers.\r\nJava has replaced the destructor function with the finalize() function.\r\nThere are no header files in Java.\r\n', 3),
(2, 'Classes and Objects in Java', '<p>Classes and Objects are basic concepts of Object Oriented Programming which revolve around the real life entities.</p><p>A class is a user defined blueprint or prototype from which objects are \r\ncreated. &nbsp;It represents the set of properties or methods that are common\r\n to all objects of one type. In general, class declarations can include \r\nthese components, in order:</p><p>Constructors are used for initializing new objects. Fields are variables\r\n that provides the state of the class and its objects, and methods are \r\nused to implement the behavior of the class and its objects.</p><p>It is a basic unit of Object Oriented Programming&nbsp;and represents the \r\nreal life entities. &nbsp;A typical Java program creates many objects, which \r\nas you know, interact by invoking methods. An object consists<br></p>', 3),
(3, 'Java Methods', '<p style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-size: 16px;\"><strong>A method is a block of code which only runs when it is called.\r\nYou can pass data, known as parameters, into a method.\r\nMethods are used to perform certain actions, and they are also known as functions.\r\nWhy use methods? To reuse code: define the code once, and use \r\nit many times.</strong></span></p><p><br></p><p style=\"color: rgb(0, 0, 0);\"><strong><span style=\"font-size: 16px;\">A method must be declared within a class. It is defined \r\nwith the name of the method, followed by parentheses (). Java provides some pre-defined methods, such as System.out.println(), but you can also create your own methods to perform certain actions.</span></strong></p><p><span style=\"font-size: 16px;\"><strong><span style=\"color: rgb(0, 0, 0);\"><br></span></strong></span></p><p><span style=\"font-size: 16px;\"><br></span></p>', 3),
(14, 'What is Big Data?', '\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\"> is a collection of large datasets that cannot be \r\nprocessed using traditional computing techniques It is not a single \r\ntechnique or a tool, rather it has become a complete subject, which \r\ninvolves various tools, technqiues and frameworks.</span></p>\r\n<ol>\r\n    <li style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(56, 118, 29);\"><em><u><strong><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">What\r\n        Comes Under Big Data?</span>\r\n        </strong>\r\n        </u>\r\n        </em>\r\n        </span>\r\n    </li>\r\n</ol>\r\n<ol>\r\n    <li><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">Big data involves the data produced by different devices and \r\napplications. Given below are some of the fields that come under the \r\numbrella of Big Data.\r\n\r\nBlack Box Data  It is a component of helicopter, \r\nairplanes, and jets, etc. It captures voices of the flight crew, \r\nrecordings of microphones and earphones, and the performance information\r\n of the aircraft.\r\nSocial Media Data  Social media such as Facebook and Twitter hold information and the views posted by millions of people across the globe.\r\nStock Exchange Data  The stock exchange data holds \r\ninformation about the buy and sell decisions made on a share of \r\ndifferent companies made by the customers.\r\nPower Grid Data  The power grid data holds information consumed by a particular node with respect to a base station. \r\nTransport Data  Transport data includes model, capacity, distance and availability of a vehicle.\r\nSearch Engine Data  Search engines retrieve lots of data from different </span><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(255, 0, 0); font-size: 18px;\">databases.</span>\r\n    </li>\r\n</ol>\r\n<ul><span style=\"color: rgb(56, 118, 29); font-family: Arial, Helvetica, sans-serif; font-size: 18px;\"><em><u><strong>Benefits of Big Data?</strong></u></em></span></ul>\r\n<span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">Using the information kept in the social network like Facebook, \r\nthe marketing agencies are learning about the response for their \r\ncampaigns, promotions, and other advertising mediums.\r\nUsing the information in the social media like preferences and \r\nproduct perception of their consumers, product companies and retail \r\norganizations are planning their production.\r\nUsing the data regarding the previous medical history of patients, hospitals are providing better and quick service.\r\n<p><br></p></span><em><strong><span style=\"color: rgb(56, 118, 29); font-size: 18px;\">Big Data Technologies:<p><br></p></span><span style=\"color: rgb(0, 0, 0); font-size: 18px;\"><p>Big data technologies are important in providing more accurate \r\nanalysis, which may lead to more concrete decision-making resulting in \r\ngreater operational efficiencies, cost reductions, and reduced risks for\r\n the business.\r\nTo harness the power of big data, you would require an infrastructure\r\n that can manage and process huge volumes of structured and unstructured\r\n data in realtime and can protect data privacy and security.\r\nThere are various technologies in the market from different vendors \r\nincluding Amazon, IBM, Microsoft, etc., to handle big data. While \r\nlooking into the technologies that handle big data, we examine the \r\nfollowing two classes of technology \r\nOperational Big Data\r\nThis include systems like MongoDB that provide operational \r\ncapabilities for real-time, interactive workloads where data is \r\nprimarily captured and stored.\r\n</p></span><span style=\"color: rgb(255, 0, 0); font-size: 18px;\"><p>NoSQL Big Data systems</p></span><span style=\"color: rgb(0, 0, 0); font-size: 18px;\"><p> are designed to take advantage of new cloud \r\ncomputing architectures that have emerged over the past decade to allow \r\nmassive computations to be run inexpensively and efficiently. This makes\r\n operational big data workloads much easier to manage, cheaper, and \r\nfaster to implement.\r\nSome NoSQL systems can provide insights into patterns and trends \r\nbased on real-time data with minimal coding and without the need for \r\ndata scientists and additional infrastructure.</p></span><p><br></p></strong></em><span style=\"color: rgb(0, 0, 0);\"><br></span><br>\r\n<ol></ol>', 18),
(15, 'What is MapReduce?', '<p><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">MapReduce is a processing technique and a program model for \r\ndistributed computing based on java. The MapReduce algorithm contains \r\ntwo important tasks, namely Map and Reduce. Map takes a set of data and \r\nconverts it into another set of data, where individual elements are \r\nbroken down into tuples (key/value pairs). Secondly, reduce task, which \r\ntakes the output from a map as an input and combines those data tuples \r\ninto a smaller set of tuples. As the sequence of the name MapReduce \r\nimplies, the reduce task is always performed after the map job.\r\nThe major advantage of MapReduce is that it is easy to scale data \r\nprocessing over multiple computing nodes. Under the MapReduce model, the\r\n data processing primitives are called mappers and reducers. Decomposing\r\n a data processing application into mappers and reducers \r\nis sometimes nontrivial. But, once we write an application in the \r\nMapReduce form, scaling the application to run over hundreds, thousands,\r\n or even tens of thousands of machines in a cluster is merely a \r\nconfiguration change. This simple scalability is what has attracted many\r\n programmers to use the MapReduce model</span></p><h2><span style=\"font-family: Arial, Helvetica, sans-serif; background-color: rgb(32, 18, 77); color: rgb(255, 255, 255);\">The Algorithm:Generally MapReduce paradigm is based on sending the computer to where the data resides!\r\nMapReduce program executes in three stages, namely map stage, shuffle stage, and reduce stage.\r\n\r\nMap stage  The map or mappers job is to process the \r\ninput data. Generally the input data is in the form of file or directory\r\n and is stored in the Hadoop file system (HDFS). The input file is \r\npassed to the mapper function line by line. The mapper processes the \r\ndata and creates several small chunks of data. \r\nReduce stage  This stage is the combination of the  Shuffle  stage and the Reduce\r\n stage. The Reducers job is to process the data that comes from the \r\nmapper. After processing, it produces a new set of output, which will be\r\n stored in the HDFS.\r\n\r\n\r\nDuring a MapReduce job, Hadoop sends the Map and Reduce tasks to the appropriate servers in the cluster.\r\nThe framework manages all the details of data-passing such as \r\nissuing tasks, verifying task completion, and copying data around the \r\ncluster between the nodes.\r\nMost of the computing takes place on nodes with data on local disks that reduces the network traffic.</span></h2><p><br></p>', 18),
(16, 'Teach Me Spanish: Equipment and Time', '<span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\">Before we begin, you will need the following:\r\n\r\nNotepad\r\nPen\r\nComputer or tablet with internet connection\r\n\r\nOptional extras:\r\n\r\nSpanish phrasebook\r\n$10  $20 per week to spend on language teachers\r\n\r\nTo follow this guide, youll need to set aside around four hours each\r\n weekend (I recommend scheduling out Saturday mornings), plus around 45 \r\nminutes per day on weekdays.\r\nI also suggest you start at the weekend to give yourself a first day boost.\r\nHeres where to start on that first day\r\n</span>', 17),
(17, 'Your First Hour', '<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Your first step in learning Spanish is to create a personalised Spanish phrasebook.\r\nWhy do this? In my approach to learning Spanish, youll focus on \r\nlearning Spanish thats relevant to you, your life, and your reasons for\r\n learning Spanish.\r\nGet a fresh notebook, and a pen, and write My Spanish Phrasebook on the cover.\r\nThis notebook will contain the Spanish phrases that you need to know, rather than the one-size-fits-all phrases found in most Spanish courses and phrasebooks.\r\nLets get that first page filled! Head to the Spanish phrases section of the Omniglot website, and write down the translations for:\r\n\r\nHello\r\nGood Morning\r\nGood Afternoon\r\nGood Evening\r\nGood Night\r\nGoodbye\r\n\r\nWhatever your reasons for learning Spanish, these are likely to be the words and phrases youll use more than any others.\r\nAs you write down the translations, click the Spanish word on \r\nOmniglot to hear the correct pronunciation. Say the words out loud as \r\nyou write them down.\r\nAlso as you write out the phrases, pick apart what you write. In \r\nother words, look inside the phrases and see how the language works. \r\nWhich part of the phrase means good? Which part means morning? \r\nFiguring this out for yourself is really powerful, because the act of \r\ndoing so burns the vocabulary into your mind.</span>', 17),
(18, 'Your First Day', '<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Your first day studying Spanish is a Scavenger Hunt of Spanish words and phrases.\r\nYour aim for today is to collect essential Spanish phrases that are specific to you and your life.\r\nIn other words, youre preparing to talk about who you are. By the \r\nend of the day, you should have gathered phrases that allow you to \r\nanswer the questions:\r\n\r\nWhats your name?\r\nWhere are you from?\r\nWhat do you do for fun?\r\nWhats your job?\r\nWhere do you work?\r\n\r\nRemember, youre looking for the words and phrases that enable you to answer these questions. When youve discovered a useful phrase, add it to your personalised phrasebook.\r\nWhere should you look? The internet is a fantastic resource, \r\nparticularly if like me youve got a job or hobby thats not in most \r\nphrasebooks (Im a travel writer, author and speaker at conferences).\r\nA phrasebook can also be helpful, as most phrasebooks include a \r\npronunciation guide. Sticking with an old-fashioned paperback phrasebook\r\n also means you avoid the potential distraction of Facebook and email.\r\nFinally, if youve got any friends that speak Spanish, give them a call and ask for their help.\r\nAs you write down the answers to these questions, dont get too \r\nfancy. Keep the sentences simple for now, so theyll be easy to \r\nremember.\r\nAlso, during your research, dont worry about collecting every phrase\r\n you discover. Ignore irrelevant phrases and pick only the ones that you\r\n think youll use during your first conversation in Spanish (Ill get to\r\n that part in a minute).\r\nTry to memorise a few phrases as you write them down. That means \r\nspeaking them out loud to yourself. Go over the phrases one final time \r\nonce youve collected them all.\r\nA word of warning: Dont stress about grammar. That will come much, much later.\r\nI like to think of learning a language as similar to learning to \r\ndrive. You could spend weeks studying the inner workings of combustion \r\nengines, and reading books about the principles of driving, yet still \r\nnot be able to drive around the block. You learn a car by driving. The \r\nsame is true of learning a language. Theres no substitute for just doing it.\r\n</span>', 17),
(19, 'Teach Me Spanish: Week 1', '<span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">On your first day, you started creating your personalised Spanish phrasebook. Now youre ready to start using it!\r\nYoull use it in several ways:\r\nFirst, revisit your phrasebook every day and work through the phrases\r\n youve noted down. This is the key to fluency: exposing yourself to the\r\n language over and over so that thoughts, phrases and responses come to \r\nyou automatically.\r\nSecond, you should add five words to your phrasebook every day. \r\nAgain, focus on adding words and phrases that are relevant to your life.\r\n If youre not sure what to add, the following are useful for most \r\npeople:\r\n\r\nNumbers\r\nDays of the week\r\nMonths of the year\r\nGreetings and pleasantries (such as How are you? and Pleased to meet you)\r\n\r\nFinally, youll use your phrasebook for your first Spanish conversation.\r\nBefore the end of this week, have your first conversation with a \r\nnative Spanish speaker. I know its a scary prospect, but dont skip \r\nover this part! Its the only way youll actually learn Spanish.\r\nWhere do you find native speaker to practise with? I recommend italki,\r\n which will hook you up with Spanish speakers you can chat with over \r\nSkype. It gives you the option of meeting with a Spanish teacher (paid, \r\nthough not expensive) or a language exchange partner (free).\r\nWhatever you do, do not skip this step. Its essential to learning \r\nthe language, and the earlier you get started, the quicker youll \r\nprogress.\r\nIf youve got the money (and it can be as little as $5) I recommend \r\nyou do your first Spanish conversation with a teacher rather than a \r\nlanguage exchange partner. Teachers are more likely to be patient with \r\nyour slow speaking speed and your mistakes, and theyll be experienced \r\nin helping you focus your learning efforts.\r\nLanguage exchanges, on the other hand, are free. However, the \r\ndownside is that you have to spend half the time helping your exchange \r\npartner speak your native language. Plus language exchange partners are \r\nlikely to be less experienced in teaching a language.\r\nBe sure to arrange with the tutor in advance to keep the lesson \r\nentirely in Spanish. This ensures that youll have a chance to practice \r\nall of the Spanish youve learned so far. Once you practice them with a \r\nreal person, trust me, youll never forget them.\r\nNeed help building your confidence to take this step? Then sign up for my free Speak in a Week course.</span>', 17),
(20, 'Teach Me Spanish: Week 2', '<span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">This week is all about embedding the vocabulary youve already learned, and expanding the tools you use to learn Spanish.\r\nYour personalised phrasebook is brilliant for collecting new words \r\nand phrases, but its not ideal for helping you memorise vocabulary. \r\nTheres where Anki comes in.\r\nAnki is available for iOS and Android,\r\n and it allows you to create your own deck of virtual flashcards to help\r\n you memorise words and phrases. What makes Anki really powerful is that\r\n is uses a Spaced Repetition System\r\n to help you memorise vocabulary. That means it prompts you to memorise \r\nwords and phrases when youre just on the verge of forgetting them. This\r\n is the most effective way of keeping them in your memory.\r\nAn added benefit with Anki is that youll have a study aid you can \r\nuse anywhere. You can pull out your phone to review a few flash cards \r\nwhenever you have a few spare moments, such as in an elevator or in line\r\n at the grocery store. By the end of the day, youll have memorized \r\nquite a few new words and phrases without ever having to set aside any \r\nexplicit study time.\r\nThis week you should start reading in Spanish too. Check out my list of Spanish reading resources\r\n for ideas on where to start. Dont expect yourself to understand \r\neverything  youll just starting out, so youll need help with most \r\nwords. Keep a virtual Spanish-English dictionary so you can look up new words as you read.\r\nWhen you read any phrases youd like to learn, add them to your personalised phrasebook and your Anki flashcard deck.\r\nFinally, keep speaking! Aim for two conversations with native Spanish speakers this week</span>', 17),
(21, 'Teach Me Spanish: Week 3', '<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">By now you should have a sizable repertoire of you-specific \r\nvocabulary, enough for a short, simple conversation in Spanish about one\r\n or two topics that interest you.\r\nThat is, if youve kept up your practice. Have you? Chances are \r\nyouve had some days when you felt super motivated, and some days when \r\nlife happened and you didnt do any language learning.\r\nIf you feel like youve stalled, this week is the time to put things right.\r\nSomething Ive learned over the years in my many language missions is\r\n that its far more effective to distribute your total weekly study time\r\n over every day of the week, than to do all of your studying in one or \r\ntwo days. Studying less often means you have to spend more time in each \r\nstudy session reviewing what you learned last time. You also risk \r\nfalling out of your routine and giving up on your language mission. So \r\nkeep up the daily studying! Even if you can only commit to a few minutes\r\n each time. Thats where Anki comes in handy.\r\nYour main task this week is to create a study schedule that works for you.\r\nIn your study sessions, keep adding to your Anki deck and your personalised phrasebook.\r\nDid you know? On your Anki deck, you can add words or phrases. Ive \r\nfound that complete phrases are more helpful on a flash card than an \r\nindividual word. Phrases give you context for the words along with \r\ncorrect examples of how to use them.\r\nFinally: Dont let this week go by without at least one \r\nconversation with a native speaker. Ideally, aim for three conversations\r\n this week. You should schedule as many face-to-face conversations \r\n(either in person or on Skype) as you can fit into your schedule. When \r\nyou look back at the end of your first month and see how far youve \r\nprogressed, youll find that conversations with native speakers were the\r\n cornerstone of your learning.</span>', 17),
(22, 'STARTING ONLINE BUSINESS:', '\r\n<p><span style=\"font-family: Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">There is number of reasons why a person looking for an additional source of income would prefer online business to\r\nany other type of venture.</span></p>\r\n<p><span style=\"font-family: Helvetica, sans-serif;\"><em style=\"color: rgb(153, 0, 0);\"><strong><u style=\"color: rgb(153, 0, 0);\"><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(153, 0, 0); font-size: 18px;\">YOU CAN START IT WITHOUT ANY EXPERIENCE AT ALL</span></u>\r\n    </strong>\r\n    </em>\r\n    </span>\r\n</p>\r\n<p><span style=\"font-family: Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">You know nothing about online business? Not a big deal. There are tons of explanatory articles,\r\neducational videos, thematic forum threads and other recourses to guide you through. You dont have to\r\nbe a software specialist or a digital marketing guru: a basic set of skills will be more than enough for this.</span></p>\r\n<p><span style=\"font-family: Helvetica, sans-serif;\"><em><u><strong><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(153, 0, 0); font-size: 18px;\">YOU CAN LAUNCH IT WITH MINIMAL COSTS</span></strong>\r\n    </u>\r\n    </em>\r\n    </span>\r\n</p>\r\n<p><span style=\"font-family: Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">There are types of online businesses that require little to no investments at the first steps of your new\r\njourney. For example, there are reselling models like drop shipping  to open a drop shipping store, you\r\ndont need to risk your money and buy products beforehand. You can start with a basic simple website,\r\nand only use free methods of marketing and promotion until you got your first profits.</span></p>\r\n<p><span style=\"font-family: Helvetica, sans-serif;\"><em><u><strong><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(153, 0, 0); font-size: 18px;\">YOU CAN MANAGE IT FROM ANY POINT ON THE GLOBE</span></strong>\r\n    </u>\r\n    </em>\r\n    </span>\r\n</p>\r\n<p><span style=\"font-family: Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">Basically, if you run any type of online business, you are not limited with geographic boundaries. You can\r\nwork wherever and whenever it is convenient for you as long as this place has stable Internet connection.\r\nA first-class co-working space, a sunny beach, your own tiny kitchen  feel free to choose any destination\r\nyou like because it won t matter at all.</span></p>\r\n<p><span style=\"font-family: Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">Whats even more important, you can always go for semi-automated business solutions. Roughly speaking, there is a\r\nparticular type of online business that can run itself.\r\nCurious to know? Lets discover it together</span></p>', 19),
(23, 'Getting started with the Android Development', '<span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\"></span><ol style=\"color: rgb(0, 0, 0);\"><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">First of all, you must have a basic knowledge of the Java language for Android Development. Learn the Java language from the Head-First Java book. Get the book from <a href=\"amzn.to/2CdSt8w\">here.</a></span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Set up Android Studio IDE of Android Development on your PC or Laptop. Refer <a href=\"https://blog.mindorks.com/install-android-studio\">here.</a></span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Take a course\r\n or any book on Android app development with which you think you are \r\ncomfortable. Being comfortable with the course or the book is very \r\nimportant. When you take the course or read the book, always apply that \r\non a sample app. I mean to say that build something on whatever you \r\nread.</span></li></ol><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\"></span>', 20),
(24, 'Learning the core of the Android Development', '<span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\"></span><ol style=\"color: rgb(0, 0, 0);\"><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Understand the Activity Lifecycle as having the knowledge of the \r\nactivity lifecycle is very important when it comes to building a \r\nbug-free application.</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Understand the Fragment and its lifecycle. It is primarily to support \r\nmore dynamic and flexible UI designs on large screens, such as tablets.</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Learn how to debug your Android application as it is the single most \r\nimportant skill for any developer. Android Studio provides a debugger \r\nthat allows you to do so many important things.</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Know about the navigations, task and back stack. Android Activities are \r\nthe logical construct of the screens that we want a user to navigate \r\nthrough. The relation that each Activity holds with respect to other is \r\nvery crucial for good user experience.</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Understanding the Context In Android Application. To develop a better Android app, we must know what context is? Context\r\n is almost everywhere in Android Development and it is the most \r\nimportant thing in the Android Development, so we must understand to use\r\n it correctly.</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Learn about the threading in detail. As the Java Virtual Machine allows \r\nan application to have multiple threads of execution running \r\nconcurrently. We must know how to take advantage of multi-threading \r\nenvironment correctly.</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Learn about the Threading Performance: Threading Performance 101. (Android Performance Patterns Season 5, Ep. 1)Understand Android Threading: Understanding Android Threading. (Android Performance Patterns Season 5, Ep. 2)Learn Memory &amp; Threading: Memory &amp; Threading. (Android Performance Patterns Season 5, Ep. 3)Understand Threadpools: Swimming in Threadpools. (Android Performance Patterns Season 5, Ep. 6)</span></li></ol><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\"></span>', 20),
(25, 'Android App Development for Beginners', '<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">This course is designed for students who are new to programming, and want to learn how to develop Android apps.\r\n Youll learn how to create an Android project with Android Studio and \r\nrun a debuggable version of the app. You ll also learn some Android \r\narchitecture and the key principles underlying its design. You will gain\r\n an understanding of the processes that are involved in an Android developed application and you will become familiar with Android development tools and user interface. By the end of the course, youll build two simple apps that you can share with your friends.\r\nOur Android course is taught by a group of Google developer experts who create innovative mobile apps.\r\nThis course is part of the GalileoX Android Developer MicroMasters Program\r\n and is specifically designed to teach the critical skills needed to be \r\nsuccessful in this exciting field and to prepare you to take the Google \r\nAssociate Android Developer Certification exam. To qualify for the \r\nMicroMasters Credential you will need to earn a Verified Certificate in \r\neach of the four courses as well as a Final Project.</span>', 20),
(26, 'Cardiovascular System', '<p style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">The cardiovascular system consists of the heart, blood vessels, and the \r\napproximately 5 liters of blood that the blood vessels transport. \r\nResponsible for transporting oxygen, nutrients, hormones, and cellular \r\nwaste products throughout the body, the cardiovascular system is powered\r\n by the bodys hardest-working organ  the heart, which is only about \r\nthe size of a closed fist. Even at rest, the average heart easily pumps \r\nover 5 liters of blood throughout the body every minute</span></p><p><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(0, 0, 0); font-size: 18px;\">The heart\r\n is a muscular pumping organ located medial to the lungs along the \r\nbodys midline in the thoracic region. The bottom tip of the heart, \r\nknown as its apex, is turned to the left, so that about 2/3 of the heart\r\n is located on the bodys left side with the other 1/3 on right. The top\r\n of the heart, known as the hearts base, connects to the great blood \r\nvessels of the body: the aorta, vena cava, pulmonary trunk, and pulmonary veins.</span></p><p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\">There are 2 primary circulatory loops in the human body: the pulmonary circulation loop and the systemic circulation loop.</span></p><ol><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\">Pulmonary circulation transports deoxygenated blood from the right side of the heart to the lungs,\r\n where the blood picks up oxygen and returns to the left side of the \r\nheart. The pumping chambers of the heart that support the pulmonary \r\ncirculation loop are the right atrium and right ventricle.</span></li><li><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\">Systemic circulation carries highly oxygenated blood from the left side \r\nof the heart to all of the tissues of the body (with the exception of \r\nthe heart and lungs). Systemic circulation removes wastes from body \r\ntissues and returns deoxygenated blood to the right side of the heart. \r\nThe left atrium and left ventricle of the heart are the pumping chambers\r\n for the systemic circulation loop</span></li><li><br></li></ol><p><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);\"><br></span></p>', 21),
(27, 'Arteries and Arterioles', '<span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\"></span><p style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Arteries are blood vessels that carry blood away from the heart. \r\nBlood carried by arteries is usually highly oxygenated, having just left\r\n the lungs on its way to the bodys tissues. The pulmonary trunk and \r\narteries of the pulmonary circulation loop provide an exception to this \r\nrule  these arteries carry deoxygenated blood from the heart to the \r\nlungs to be oxygenated.</span></p>\r\n\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Arteries face high levels of blood pressure as they carry blood being\r\n pushed from the heart under great force. To withstand this pressure, \r\nthe walls of the arteries are thicker, more elastic, and more muscular \r\nthan those of other vessels. The largest arteries of the body contain a \r\nhigh percentage of elastic tissue that allows them to stretch and \r\naccommodate the pressure of the heart.</span></p>\r\n\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Smaller arteries are more muscular in the structure of their walls. \r\nThe smooth muscles of the arterial walls of these smaller arteries \r\ncontract or expand to regulate the flow of blood through their lumen. In\r\n this way, the body controls how much blood flows to different parts of \r\nthe body under varying circumstances. The regulation of blood flow also \r\naffects blood pressure, as smaller arteries give blood less area to flow\r\n through and therefore increases the pressure of the blood on arterial \r\nwalls.</span></p>\r\n\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\">Arterioles are narrower arteries that branch off from the ends of \r\narteries and carry blood to capillaries. They face much lower blood \r\npressures than arteries due to their greater number, decreased blood \r\nvolume, and distance from the direct pressure of the heart. Thus \r\narteriole walls are much thinner than those of arteries. Arterioles, \r\nlike arteries, are able to use smooth muscle to control their aperture \r\nand regulate blood flow and blood pressure.</span></p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px;\"></span>', 21),
(28, 'Capillaries and Veins and Venules', '<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\">Capillaries are the smallest and thinnest of the blood vessels in the\r\n body and also the most common. They can be found running throughout \r\nalmost every tissue of the body and border the edges of the bodys \r\navascular tissues. Capillaries connect to arterioles on one end and venules on the other.\r\n\r\nCapillaries carry blood very close to the cells of the tissues of the\r\n body in order to exchange gases, nutrients, and waste products. The \r\nwalls of capillaries consist of only a thin layer of endothelium so that\r\n there is the minimum amount of structure possible between the blood and\r\n the tissues. The endothelium acts as a filter to keep blood cells \r\ninside of the vessels while allowing liquids, dissolved gases, and other\r\n chemicals to diffuse along their concentration gradients into or out of\r\n tissues.\r\n\r\nPrecapillary sphincters are bands of smooth muscle found at the \r\narteriole ends of capillaries. These sphincters regulate blood flow into\r\n the capillaries. Since there is a limited supply of blood, and not all \r\ntissues have the same energy and oxygen requirements, the precapillary \r\nsphincters reduce blood flow to inactive tissues and allow free flow \r\ninto active tissues.</span></p><p><p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\">Veins are the large return vessels of the body and act as the blood \r\nreturn counterparts of arteries. Because the arteries, arterioles, and \r\ncapillaries absorb most of the force of the hearts contractions, veins \r\nand venules are subjected to very low blood pressures. This lack of \r\npressure allows the walls of veins to be much thinner, less elastic, and\r\n less muscular than the walls of arteries.</span></p>\r\n\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\">Veins rely on gravity, inertia, and the force of skeletal muscle \r\ncontractions to help push blood back to the heart. To facilitate the \r\nmovement of blood, some veins contain many one-way valves that prevent \r\nblood from flowing away from the heart. As skeletal muscles in the body \r\ncontract, they squeeze nearby veins and push blood through valves closer\r\n to the heart.</span></p>\r\n\r\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 18px; color: rgb(0, 0, 0);\">When the muscle relaxes, the valve traps the blood until another \r\ncontraction pushes the blood closer to the heart. Venules are similar to\r\n arterioles as they are small vessels that connect capillaries, but \r\nunlike arterioles, venules connect to veins instead of arteries. Venules\r\n pick up blood from many capillaries and deposit it into larger veins \r\nfor transport back to the heart.</span></p></p>', 21),
(29, 'Notions fondamentales de la thermodynamique', '<p>La  thermodynamique  est  une  science  qui  nait   la  fin  du 17mesicle. Lessentiel  lpoque tait de construire des machines indispensables  lindustrie naissante.</p><p>On rapporte que Denis PAPIN(Physicien franais, 1647-1714) a eu lide de construire une machine utilisant de la vapeur deau en regardant leau bouillit dans un rcipient.  En voyant la vapeur soulevant le couvercle, il a constat  quelle pourrait donc aussi repousser un piston et ainsi fournir du travail.La  motivation  initiale  tait  donc  de  rpondre    un  besoin  industriel  essentiel    lpoque: trouver les conditions optimales pour transformerla chaleuren travail. On trouve dans cette phrase  les  trois (03)  mots  fondateurs  de  la  thermodynamique.  Ce  non  (thermodynamique) vient du grec signifiant respectivement chaleuret force. On peut dcrire la thermodynamique de deux (02) manires ou selon deux (02) aspects  diffrents:</p><ul><li>Laspect macroscopique: on sintresse aux proprits de la matire de la manire o le systme  lchelle globale ou macroscopique, alors les proprits sont dcrites par des variables dtat macroscopiques (P, V, T, m, ...).</li></ul><ul><li>Laspect  microscopique:  on  sintresse  aux  proprits  de la  matire    lchelle microscopique  ou  atomique  en  utilisant  comme  variables  les  grandeurs  cintiques individuelles des molcules ou des atomes (Pi, Vi, Ei, ...)</li></ul>Selon  que  lon  considre  lun  ou  lautre  de  ces  deux  aspects,  on  distingue  alors  entre  la thermodynamique classique ou statique.<ul><li>a. Thermodynamique classique<br></li></ul>', 22),
(30, 'Thermodynamique statique', '<span style=\"font-family: Georgia, serif; font-size: 18px;\"></span><p style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Georgia, serif; font-size: 18px;\">Elle cherche  expliquer lorigineet  la  signification  des  variables  macroscopiques  (P,  T)  et des notions de chaleurs, de travail et e lentropie en les reliant directement au mcanisme de lagitation  molculaire.  Ainsi  on  distingue  les  notions  de  temprature,  de  pression  et  de chaleur.</span></p><p><span style=\"font-family: Georgia, serif; font-size: 18px;\">La temprature est relie au degr dagitation molculaire de la matire. Si la vitesse Vides molcules  et  donc leur nergie  cintiqueEi augmentent, alors le degr dagitation thermique du milieu est plus grand.A la temprature 0 K (Zro absolu  -273C), les atomes et les molcules qui constituent la matire sont figes.</span></p><p><span style=\"font-family: Georgia, serif; font-size: 18px;\">Un  gaz  contenu  dans  une  enceinte.  A  lchelle  microscopique,  les  molcules du  gaz se dplacent dans lenceinte de faontotalement alatoireavec des vitesses V</span></p><p><span style=\"font-family: Georgia, serif; font-size: 18px;\">Donc  la temprature est dfinie par la relationsuivante:   O:Mest la masse des particules.Vest la vitesse des particules qui constituent la matire.k est une constante.Test la temprature de la matire.</span></p><span style=\"font-family: Georgia, serif; font-size: 18px;\"></span>', 22),
(31, 'Notion de la pression', '<p>La pression est due aux nombreux chocs des atomes ou molcules de la matire sur les parois du rcipient.</p><p>P est la pression du gaz au sein de lenceinte.Mest la masse des molcules degaz.Vest la vitesse des molcules degaz.On distingue entre pression absolue et relative et entre pression totale et partielle</p><p>4Soit  = N/V: le nombre de molculesde gaz dans lenceinte par unit de volume.Donc, on dfinit la pression par la relationsuivante:O:P est la pression du gaz au sein de lenceinte.Mest la masse des molcules degaz.Vest la vitesse des molcules degaz.On distingue entre pression absolue et relative et entre pression totale et partielleO: Pabs: Pression absolue.Prel:  Pression relative.Patm: Pression atmosphrique</p><p>Pi: Pression partielle.Xi  : Fraction molaire.PT  : Pression totale.</p><p>Les changes de lnergie de la matire se prsentent sous deux formes possibles;la chaleur(Q) ou le travail (W).Ces deux formes sont interprtes  lchelle microscopique comme une manifestation de lagitation des molcules et des atomes sous forme dsordonne (chaleur Q), ou ordonne (travail W).<br></p>', 22);

